import Image1 from '../images/first.png';
import Image2 from '../images/second.png';
import Image3 from '../images/third.png';

export const cardInfoData = [
  { icon: Image1, title: 'CELO', apy: '10% APY' },
  { icon: Image2, title: 'cUSD', apy: '10% APY' },
  { icon: Image3, title: 'UBE', apy: '10% APY' },
];
